# B Derivation of Difference Between Unadjusted and Adjusted OLS Estimators 

Consider a more compact form for the proposed semi-parametric model:

$$
\mathbf{Y}=\tilde{\mathbf{X}} \boldsymbol{\beta}+\mathbf{B} \tilde{\boldsymbol{\xi}}+\tilde{\boldsymbol{\epsilon}}=\mathbf{A} \boldsymbol{\theta}+\tilde{\boldsymbol{\epsilon}}
$$

where $\mathbf{A}=\left[\begin{array}{ll}\tilde{\mathbf{X}} & \mathbf{B}\end{array}\right]$ indicates the $n \times(p+2)$ full design matrix where $\tilde{\mathbf{X}}$ and $\mathbf{B}$ are bound columnwise, and $\boldsymbol{\theta}=\left(\boldsymbol{\beta}^{\prime}, \tilde{\boldsymbol{\xi}}^{\prime}\right)^{\prime}$ is the associated vector of coefficients.

The expected value of the adjusted OLS estimator is:

$$
\begin{aligned}
E\left[\widehat{\boldsymbol{\theta}}_{O L S} \mid \mathbf{X}=\mathbf{x}\right] & =\left(\mathbf{A}^{\prime} \mathbf{A}\right)^{-1} \mathbf{A}^{\prime} E[\mathbf{Y} \mid \mathbf{X}=\mathbf{x}] \\
& =\left(\mathbf{A}^{\prime} \mathbf{A}\right)^{-1} \mathbf{A}^{\prime}\left(\tilde{\mathbf{X}} \boldsymbol{\beta}+\boldsymbol{\mu}_{w \mid x}\right) \\
& =\left(\mathbf{A}^{\prime} \mathbf{A}\right)^{-1} \mathbf{A}^{\prime} \tilde{\mathbf{X}} \boldsymbol{\beta}+\delta \frac{\sigma_{w}}{\sigma_{z}}\left(\mathbf{A}^{\prime} \mathbf{A}\right)^{-1} \mathbf{A}^{\prime} \mathbf{R}_{\phi_{w}}^{1 / 2} \mathbf{R}_{\phi_{x}}^{-1 / 2} \mathbf{x}
\end{aligned}
$$

Since $\mathbf{A}^{\prime} \mathbf{A}$ is a block matrix, it follows that:

$$
\left(\mathbf{A}^{\prime} \mathbf{A}\right)^{-1}=\left[\begin{array}{cc}
\tilde{\mathbf{X}}^{\prime} \tilde{\mathbf{X}} & \tilde{\mathbf{X}}^{\prime} \mathbf{B} \\
\mathbf{B}^{\prime} \tilde{\mathbf{X}} & \mathbf{B}^{\prime} \mathbf{B}
\end{array}\right]^{-1}=\left[\begin{array}{cc}
\mathbf{Q} & -\mathbf{T} \\
\boldsymbol{\Xi} & \mathbf{S}^{-1}
\end{array}\right]
$$

and

$$
E\left[\widehat{\boldsymbol{\theta}}_{O L S} \mid \mathbf{X}=\mathbf{x}\right]=\left(\mathbf{A}^{\prime} \mathbf{A}\right)^{-1} \mathbf{A}^{\prime} \tilde{\mathbf{X}} \boldsymbol{\beta}+\delta \frac{\sigma_{w}}{\sigma_{z}}\left[\begin{array}{cc}
\mathbf{Q} & -\mathbf{T} \\
\boldsymbol{\Xi} & \mathbf{S}^{-1}
\end{array}\right]\left[\begin{array}{c}
\mathbf{X}^{\prime} \\
\mathbf{B}^{\prime}
\end{array}\right] \mathbf{R}_{\phi_{w}}^{1 / 2} \mathbf{R}_{\phi_{x}}^{-1 / 2} \mathbf{x}
$$

where $\mathbf{Q}=\left(\tilde{\mathbf{X}}^{\prime} \tilde{\mathbf{X}}\right)^{-1}+\mathbf{T B}^{\prime} \tilde{\mathbf{X}}\left(\tilde{\mathbf{X}}^{\prime} \tilde{\mathbf{X}}\right)^{-1}, \mathbf{T}=\left(\tilde{\mathbf{X}}^{\prime} \tilde{\mathbf{X}}\right)^{-1} \tilde{\mathbf{X}}^{\prime} \mathbf{B S}^{-1}, \boldsymbol{\Xi}=-\mathbf{S}^{-1} \mathbf{B}^{\prime} \tilde{\mathbf{X}}\left(\tilde{\mathbf{X}}^{\prime} \tilde{\mathbf{X}}\right)^{-1}$, and $\mathbf{S}=$ $\mathbf{B}^{\prime} \mathbf{B}-\mathbf{B}^{\prime} \tilde{\mathbf{X}}\left(\tilde{\mathbf{X}}^{\prime} \tilde{\mathbf{X}}\right)^{-1} \tilde{\mathbf{X}}^{\prime} \mathbf{B}$.

We will consider only the first two elements of this expectation vector in what follows. The first term in (16) gives $\boldsymbol{\beta}$, as expected. The second term refers to the bias, which we indicate as $\Delta_{a d j}$, and is equal to:

$$
\Delta_{a d j}=\delta \frac{\sigma_{w}}{\sigma_{z}}\left(\mathbf{Q} \tilde{\mathbf{X}}^{\prime}-\mathbf{T B}^{\prime}\right) \mathbf{R}_{\phi_{w}}^{1 / 2} \mathbf{R}_{\phi_{z}}^{-1 / 2} \mathbf{x}
$$

With some algebra, it turns out that

$$
\begin{aligned}
\Delta_{a d j} & =\delta \frac{\sigma_{w}}{\sigma_{z}}\left\{\left(\tilde{\mathbf{X}}^{\prime} \tilde{\mathbf{X}}\right)^{-1} \tilde{\mathbf{X}}^{\prime}+\mathbf{T B}^{\prime} \tilde{\mathbf{X}}\left(\tilde{\mathbf{X}}^{\prime} \tilde{\mathbf{X}}\right)^{-1} \tilde{\mathbf{X}}^{\prime}-\mathbf{T B}^{\prime}\right\} \mathbf{R}_{\phi_{w}}^{1 / 2} \mathbf{R}_{\phi_{z}}^{-1 / 2} \mathbf{x} \\
& =\delta \frac{\sigma_{w}}{\sigma_{z}}\left(\tilde{\mathbf{X}}^{\prime} \tilde{\mathbf{X}}\right)^{-1} \tilde{\mathbf{X}}^{\prime} \mathbf{R}_{\phi_{w}}^{1 / 2} \mathbf{R}_{\phi_{z}}^{-1 / 2} \mathbf{x}+\delta \frac{\sigma_{w}}{\sigma_{z}}\left\{\mathbf{T B}^{\prime} \tilde{\mathbf{X}}\left(\tilde{\mathbf{X}}^{\prime} \tilde{\mathbf{X}}\right)^{-1} \tilde{\mathbf{X}}^{\prime}-\mathbf{T B}^{\prime}\right\} \mathbf{R}_{\phi_{w}}^{1 / 2} \mathbf{R}_{\phi_{z}}^{-1 / 2} \mathbf{x} \\
& =\Delta_{O L S}+\delta \frac{\sigma_{w}}{\sigma_{z}} \mathbf{T B}^{\prime}\left\{\tilde{\mathbf{X}}\left(\tilde{\mathbf{X}}^{\prime} \tilde{\mathbf{X}}\right)^{-1} \tilde{\mathbf{X}}^{\prime}-\mathbf{I}_{n}\right\} \mathbf{R}_{\phi_{w}}^{1 / 2} \mathbf{R}_{\phi_{x}}^{-1 / 2} \mathbf{x} \\
& =\Delta_{O L S}+\left[\begin{array}{c}
d_{0} \\
d_{x}
\end{array}\right]
\end{aligned}
$$

We have discussed three types of "null space", namely:

Type 1. $\mathbf{U}=\left[\begin{array}{ccc}1 & \mathbf{s}_{1}[1] & \mathbf{s}_{1}[2] \\ & \vdots & \\ 1 & \mathbf{s}_{n}[1] & \mathbf{s}_{n}[2]\end{array}\right]$ and $q=3$
Type 2. $\mathbf{U}=\left[\begin{array}{cccc}1 & X\left(\mathbf{s}_{1}\right) & \mathbf{s}_{1}[1] & \mathbf{s}_{1}[2] \\ & \vdots & \vdots & \\ 1 & X\left(\mathbf{s}_{n}\right) & \mathbf{s}_{n}[1] & \mathbf{s}_{n}[2]\end{array}\right]$ and $q=4$
Type 3. $\mathbf{U}=\tilde{\mathbf{X}}$ and $q=2$

Let $\mathbf{C}$ denote the matrix collecting easting and northing coordinates of the $n$ sampling locations, and $\mathbf{V}^{*}$ be the matrix containing the eigenvectors $\mathbf{v}_{q+1}, \ldots, \mathbf{v}_{n}$ corresponding to the non-null eigenvalues. Under the type-2 null space, it follows that $\mathbf{A}=\left[\begin{array}{lll}\tilde{\mathbf{X}} & \mathbf{C} & \mathbf{V}^{*}\end{array}\right]$, and $\mathbf{B}=\mathbf{V}^{*}$.
The components of the block inverse in Equation (15) become:

$$
\begin{aligned}
\mathbf{S} & =\mathbf{I}_{n-q}, \quad q=4 \\
\mathbf{T} & =\mathbf{0} \\
\mathbf{Q} & =\left[\begin{array}{cc}
\tilde{\mathbf{X}}^{\prime} \tilde{\mathbf{X}} & \tilde{\mathbf{X}}^{\prime} \mathbf{C} \\
\mathbf{C}^{\prime} \tilde{\mathbf{X}} & \mathbf{C}^{\prime} \mathbf{C}
\end{array}\right]
\end{aligned}
$$

Because of the orthogonality between $\left[\begin{array}{ll}\mathbf{X} & \mathbf{C}\end{array}\right]$ and $\mathbf{V}^{*}$, it turns out that $\Delta_{a d j}$ does not depend on the bases in $\mathbf{V}^{*}$ anymore:

$$
\begin{aligned}
\Delta_{a d j} & =\Delta_{O L S} \\
& +\delta \frac{\sigma_{w}}{\sigma_{z}}\left[\left(\widehat{\mathbf{X}}^{\prime} \widehat{\mathbf{X}}\right)^{-1} \widehat{\mathbf{X}}^{\prime} \mathbf{C}\left\{\mathbf{C}^{\prime}\left(\mathbf{I}_{n}-\widehat{\mathbf{X}}\left(\widehat{\mathbf{X}}^{\prime} \widehat{\mathbf{X}}\right)^{-1} \widehat{\mathbf{X}}^{\prime}\right) \mathbf{C}\right\}^{-1} \mathbf{C}^{\prime} \widehat{\mathbf{X}}\left(\widehat{\mathbf{X}}^{\prime} \widehat{\mathbf{X}}\right)^{-1} \widehat{\mathbf{X}}^{\prime}\right. \\
& \left.-\left\{\mathbf{X}^{\prime}\left(\mathbf{I}_{n}-\mathbf{C}\left(\mathbf{C}^{\prime} \mathbf{C}\right)^{-1} \mathbf{C}^{\prime}\right) \widehat{\mathbf{X}}\right\}^{-1} \widehat{\mathbf{X}}^{\prime} \mathbf{C}\left(\mathbf{C}^{\prime} \mathbf{C}\right)^{-1} \mathbf{C}^{\prime}\right] \mathbf{R}_{\phi_{w}}^{1 / 2} \mathbf{R}_{\phi_{z}}^{-1 / 2} \mathbf{x}
\end{aligned}
$$

so the confounding bias can be reduced only through the inclusion of the spatial coordinates in the model.

In the case of type-3 null space, it results that $\mathbf{A}=\left[\begin{array}{ll}\mathbf{X} & \mathbf{V}^{*}\end{array}\right], \mathbf{B}=\mathbf{V}^{*}$ and that

$$
\begin{aligned}
& \mathbf{S}=\mathbf{I}_{n-q}, \quad q=2 \\
& \mathbf{T}=\mathbf{0} \\
& \mathbf{Q}=\left(\widehat{\mathbf{X}}^{\prime} \widehat{\mathbf{X}}\right)^{-1}
\end{aligned}
$$

Thus, $\Delta_{a d j}=\Delta_{O L S}$ and there is no confounding adjustment.

## D. 2 Difference Between Bayesian and Frequentist Estimators

The foregoing analysis has not taken into consideration how the prior distributions assumed on the basis coefficients impact on the confounding bias. Following a reasoning similar in spirit to that of Hans (2009), it is possible to compare the unadjusted OLS estimator with the mean of the posterior distribution of $\beta_{x}$, when the bases are included. For notational convenience, let the latter quantity be denoted as $\boldsymbol{\beta}_{\text {post }}=E[\boldsymbol{\beta} \mid \bullet]$. We demonstrate that their difference, $d_{x}^{*}=\boldsymbol{\beta}_{\text {post }}-\widehat{\boldsymbol{\beta}}_{O L S}$, is equal to

the second element of the following vector:

$$
\left[\begin{array}{c}
d_{0}^{*} \\
d_{x}^{*}
\end{array}\right]=\mathbf{T B}^{\prime}\left(\widehat{\mathbf{Y}}_{O L S}-\mathbf{Y}\right) / \widetilde{\sigma}_{\epsilon}^{2}
$$

where $\widehat{\boldsymbol{\beta}}_{O L S}$ and $\widehat{\mathbf{Y}}_{O L S}=\tilde{\mathbf{X}} \widehat{\boldsymbol{\beta}}_{O L S}$ are, respectively, the estimate and the vector of fitted values under the unadjusted OLS model, but now $\mathbf{T}$ is not the same as before since it derives from the inversion of another block matrix which depends on the priors.

Proof. Starting again from Equation (14), now the expected value of the conditional posterior of $\boldsymbol{\theta}$ is of interest. If non-informative independent priors are assumed on all the parameters, we have:

$$
E[\boldsymbol{\theta} \mid \bullet]=\left(\mathbf{A}^{\prime} \mathbf{A} / \widetilde{\sigma}_{\epsilon}^{2}+\mathbf{V}_{\boldsymbol{\theta}}^{-1}\right)^{-1} \mathbf{A}^{\prime} \mathbf{y} / \widetilde{\sigma}_{\epsilon}^{2}
$$

where

$$
\mathbf{V}_{\boldsymbol{\theta}}^{-1}=\left[\begin{array}{cc}
\mathbf{V}_{\boldsymbol{\beta}}^{-1} & \mathbf{0} \\
\mathbf{0} & \mathbf{V}_{\boldsymbol{\xi}}^{-1}
\end{array}\right]
$$

Since we use non-informative priors on $\boldsymbol{\beta}$, the upper-left block of $\mathbf{V}_{\boldsymbol{\theta}}^{-1}$ tends to the null matrix, thus:

$$
\begin{aligned}
\left(\mathbf{A}^{\prime} \mathbf{A} / \widetilde{\sigma}_{\epsilon}^{2}+\mathbf{V}_{\boldsymbol{\theta}}^{-1}\right)^{-1} & \approx\left[\begin{array}{cc}
\tilde{\mathbf{X}}^{\prime} \tilde{\mathbf{X}} / \widetilde{\sigma}_{\epsilon}^{2} & \tilde{\mathbf{X}}^{\prime} \mathbf{B} / \widetilde{\sigma}_{\epsilon}^{2} \\
\mathbf{B}^{\prime} \tilde{\mathbf{X}}^{\prime} / \widetilde{\sigma}_{\epsilon}^{2} & \mathbf{B}^{\prime} \mathbf{B} / \widetilde{\sigma}_{\epsilon}^{2}+\mathbf{V}_{\boldsymbol{\xi}}^{-1}
\end{array}\right]^{-1}= \\
& =\left[\begin{array}{cc}
\mathbf{Q} & -\mathbf{T} \\
\boldsymbol{\Xi} & \mathbf{S}^{-1}
\end{array}\right]
\end{aligned}
$$

where

$$
\begin{gathered}
\mathbf{S}=\mathbf{B}^{\prime} \mathbf{B} / \widetilde{\sigma}_{\epsilon}^{2}+\mathbf{V}_{\boldsymbol{\xi}}^{-1}-\mathbf{B}^{\prime} \tilde{\mathbf{X}}\left(\tilde{\mathbf{X}}^{\prime} \tilde{\mathbf{X}}\right)^{-1} \tilde{\mathbf{X}}^{\prime} \mathbf{B} / \widetilde{\sigma}_{\epsilon}^{2} \\
\mathbf{T}=\left(\tilde{\mathbf{X}}^{\prime} \tilde{\mathbf{X}}\right)^{-1} \tilde{\mathbf{X}}^{\prime} \mathbf{B} \mathbf{S}^{-1} \\
\mathbf{Q}=\left(\tilde{\mathbf{X}}^{\prime} \tilde{\mathbf{X}}\right)^{-1} \widetilde{\sigma}_{\epsilon}^{2}+\mathbf{T B}^{\prime} \tilde{\mathbf{X}}\left(\tilde{\mathbf{X}}^{\prime} \tilde{\mathbf{X}}\right)^{-1} \\
\boldsymbol{\Xi}=-\mathbf{S}^{-1} \mathbf{B}^{\prime} \tilde{\mathbf{X}}\left(\tilde{\mathbf{X}}^{\prime} \tilde{\mathbf{X}}\right)^{-1}
\end{gathered}
$$

Now we can focus on the first two elements of $\boldsymbol{\theta}$, i.e., $\boldsymbol{\beta}$, to obtain:

$$
\begin{aligned}
\boldsymbol{\beta}_{\text {post }} & =\left(\mathbf{Q X}^{\prime}-\mathbf{T B}^{\prime}\right) \mathbf{y} / \widetilde{\sigma}_{\epsilon}^{2} \\
& =\widehat{\boldsymbol{\beta}}_{O L S}+\mathbf{T B}^{\prime} \tilde{\mathbf{X}} \widehat{\boldsymbol{\beta}}_{O L S} / \widetilde{\sigma}_{\epsilon}^{2}-\mathbf{T B}^{\prime} \mathbf{Y} / \widetilde{\sigma}_{\epsilon}^{2} \\
& =\widehat{\boldsymbol{\beta}}_{O L S}+\mathbf{T B}^{\prime}\left(\widehat{\mathbf{Y}}_{O L S}-\mathbf{Y}\right) / \widetilde{\sigma}_{\epsilon}^{2} \\
& =\widehat{\boldsymbol{\beta}}_{O L S}+\left[\begin{array}{c}
d_{0}^{*} \\
d_{x}^{*}
\end{array}\right]
\end{aligned}
$$

Therefore, $d_{x}^{*}$ can be obtained using either an "empirical formula", that is as a difference between Bayesian and frequentist estimators, or an "analytic formula", which depends on the bases, the residuals from the unadjusted OLS fit, and the prior structure assumed on the basis coefficients.

For the type-2 null space, we are not assuming spike-and-slab priors on the spatial coordinates, so a large variance is imposed to the respective coefficients, and the previous formulae can be simplified: from the orthogonality between $\left[\begin{array}{ll}\mathbf{X} & \mathbf{C}\end{array}\right]$ and $\mathbf{V}^{*}$, the matrix $\left(\mathbf{A}^{\prime} \mathbf{A} / \widetilde{\sigma}_{\epsilon}^{2}+\mathbf{V}_{\boldsymbol{\theta}}^{-1}\right)$ becomes blockdiagonal and its inverse is:

$$
\left(\mathbf{A}^{\prime} \mathbf{A} / \widetilde{\sigma}_{\epsilon}^{2}+\mathbf{V}_{\boldsymbol{\theta}}^{-1}\right)^{-1} \approx\left[\begin{array}{c}
\widetilde{\sigma}_{\epsilon}^{2}\left[\begin{array}{cc}
\tilde{\mathbf{X}}^{\prime} \tilde{\mathbf{X}} & \tilde{\mathbf{X}}^{\prime} \mathbf{C} \\
\mathbf{C}^{\prime} \tilde{\mathbf{X}} & \mathbf{C}^{\prime} \mathbf{C}
\end{array}\right]^{-1} \\
\mathbf{0} \\
\left(\mathbf{I}_{n-q} / \widetilde{\sigma}_{\epsilon}^{2}+\mathbf{V}_{\boldsymbol{\xi}}^{*,-1}\right)^{-1}
\end{array}\right]
$$

where $\mathbf{V}_{\boldsymbol{\xi}}^{*}$ is $\mathbf{V}_{\boldsymbol{\xi}}$ without the first two columns and the first two rows.
It turns out that the posterior mean does not depend on the bases:

$$
\begin{aligned}
\boldsymbol{\beta}_{\text {post }} & =\widehat{\boldsymbol{\beta}}_{O L S}+\left(\tilde{\mathbf{X}}^{\prime} \tilde{\mathbf{X}}\right)^{-1} \tilde{\mathbf{X}}^{\prime} \mathbf{C}\left\{\mathbf{C}^{\prime}\left(\mathbf{I}_{n}-\tilde{\mathbf{X}}\left(\tilde{\mathbf{X}}^{\prime} \tilde{\mathbf{X}}\right)^{-1} \tilde{\mathbf{X}}^{\prime}\right) \mathbf{C}\right\}^{-1} \mathbf{C}^{\prime} \widehat{\mathbf{Y}}_{O L S} \\
& -\left\{\mathbf{X}^{\prime}\left(\mathbf{I}_{n}-\mathbf{C}\left(\mathbf{C}^{\prime} \mathbf{C}\right)^{-1} \mathbf{C}^{\prime}\right) \tilde{\mathbf{X}}\right\}^{-1} \tilde{\mathbf{X}}^{\prime} \mathbf{C}\left(\mathbf{C}^{\prime} \mathbf{C}\right)^{-1} \tilde{\mathbf{X}}^{\prime} \mathbf{Y}
\end{aligned}
$$

As for the type-3 null space, given the independence between $\tilde{\mathbf{X}}$ and each eigenvector, the posterior mean simplifies to the OLS estimate. In fact:

$$
\begin{aligned}
\left(\mathbf{A}^{\prime} \mathbf{A} / \widetilde{\sigma}_{\epsilon}^{2}+\mathbf{V}_{\boldsymbol{\theta}}^{-1}\right)^{-1} & \approx\left[\begin{array}{cc}
\tilde{\mathbf{X}}^{\prime} \tilde{\mathbf{X}} / \widetilde{\sigma}_{\epsilon}^{2} & \mathbf{0} \\
\mathbf{0} & \mathbf{I}_{n-q} / \widetilde{\sigma}_{\epsilon}^{2}+\mathbf{V}_{\boldsymbol{\xi}}^{-1}
\end{array}\right]^{-1}= \\
& =\left[\begin{array}{cc}
\left(\tilde{\mathbf{X}}^{\prime} \tilde{\mathbf{X}}\right)^{-1} \widetilde{\sigma}_{\epsilon}^{2} & \mathbf{0} \\
\mathbf{0} & \left(\mathbf{I}_{n-q} / \widetilde{\sigma}_{\epsilon}^{2}+\mathbf{V}_{\boldsymbol{\xi}}^{-1}\right)^{-1}
\end{array}\right]
\end{aligned}
$$

which implies that $\boldsymbol{\beta}_{\text {post }}=\left(\tilde{\mathbf{X}}^{\prime} \tilde{\mathbf{X}}\right)^{-1} \tilde{\mathbf{X}}^{\prime} \mathbf{Y}=\widehat{\boldsymbol{\beta}}_{O L S}$.

The bottom panels of Figure 5 show boxplots of $\overline{d_{x}^{*}}=E\left[d_{x}^{*} \mid \bullet\right]$ over the hundred replicates. The results, using both empirical (represented by dashed lines) and analytic (solid lines) formulae, are plotted for each configuration and prior structure. There is an overall correspondence of the results obtained by the formulae, however in the pMOM case a workaround was necessary. Since there is not a closed-form full conditional distribution for the coefficients, it was not possible to derive an analytic formula. Hence, we show what would have happened if the bases in the pMOM case were selected under the fixed-variance prior structure. Again, we see that

the results are consistent with our findings in Section 5 of the paper, and that SS_mom performs better than the other two approaches, since $\overline{d_{x}^{*}}$ is almost always smaller than or equal to zero.
